const Plp = props => {
    console.log("plp props: ",props)
    return (
		<>
			{props.list.map((product, index) => (
                <div className='plp-card'>
                    <div className='image-container'>
                        <img src={product.image} alt='product'></img>
                    </div>
                </div>
			))}
		</>
    )
}

export default Plp
